const App = () =>{
  return( 
    <main>
        <form className="fomulario">
          <div className="containerCampos">
            <div className="campo">
              <label htmlFor="">Nombre: </label>
              <input type="text" placeholder="Nombre"/>
            </div>
            <div className="campo">
              <label htmlFor="">estado: </label>
              <input type="text" placeholder="estado"/> 
            </div>
            <div className="campo">
              <label htmlFor="">Fecha: </label>
            </div>

          </div>

        </form>
    </main>
  );
}

export default App;
